import './App.css';
import RegisterForm from './components/RegisterForm'
import HomePage from './components/HomePage';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <RegisterForm />
        <HomePage />
        <form action="../../post" method="post"
          className="form">
          <button type="submit">Connected?</button>
        </form>
      </header>
    </div>
  );
}

export default App;
